import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import './index.css';
import Sdata from './Sdata';


ReactDOM.render(
  <>

    <h1 className='heading_style' >My Favourite 5 Netflix Series in 2022</h1>

    <Card
      imgsrc={Sdata[0].imgsrc} 
      title={Sdata[0].title}
      sname={Sdata[0].sname}
      link={Sdata[0].link}
    />
