      imgsrc='https://occ-0-2086-2186.1.nflxso.net/dnm/api/v6/X194eJsgWBDE2aQbaNdmCXGUP-Y/AAAABezDDKSB_TT3eGZL71SuvQrV11Z-FSSrG-vYmCPMGW63UOf4VB2Ls94sHw6ovIL0aCN63IkaLaSTMM6JckTfN4tO28nN2J6DC_rEP-_cIs3XvDUTd2JyHJ7NXXGDNX6m71F6zw.jpg' 
      title='A Netflix Original Series'
      sname='Kingdom'
      link='https://www.netflix.com/in/title/80180171'

    />
    <Card 
